from django.test import TestCase
from .models import AuctionListings, AuctionBids
from django.utils import timezone

# Create your tests here.
class DataBaseTests(TestCase):

	def test_insert_into_listings(self):
		listing = AuctionListings(name = "Ball 15", user_name = "shurik", count_bids = 0, price = 200, 
									description = "it is a good basketball ball", 
									image_url = "data:image/jpeg;base64,", 
									created_date = timezone.now(), actual = True)
		listing.save()
		listing = AuctionListings.objects.get(name = "Ball 15")
		self.assertEqual(listing.name, "Ball 15")
		listing.delete()

	def test_update_listings(self):
		listing = AuctionListings(name = "Ball", user_name = "shurik", count_bids = 0, price = 200, 
			description = "it is a good basketball ball", 
			image_url = "data:image/jpeg;base64,", 
			created_date = timezone.now(), actual = True)
		listing.save()
		listing = AuctionListings.objects.get(name = "Ball")
		listing.count_bids += 1
		listing.save()
		listing = AuctionListings.objects.get(name = "Ball")
		self.assertEqual(listing.count_bids, 1)
		listing.delete()

	def test_insert_to_bids(self):
		listing = AuctionListings(name = "Ball", user_name = "shurik", count_bids = 0, price = 200, 
			description = "it is a good basketball ball", 
			image_url = "data:image/jpeg;base64,", 
			created_date = timezone.now(), actual = True)
		listing.save()
		listing = AuctionListings.objects.get(name = "Ball")
		date = timezone.now()
		listing.auctionbids_set.create(bid_price=200, user_bid='fty', date=date)
		listing.count_bids += 1
		listing.save()
		listing = AuctionListings.objects.get(name = "Ball")
		bid = AuctionBids.objects.get(listing_name = "Ball")
		self.assertEqual(listing.count_bids, 1)
		self.assertEqual(bid.listing_name.name, 'Ball')



